def factorize(V, n):
    model = NMF(n_components=n, init="random", random_state=0)
    W = model.fit_transform(V) # 725x10 , each column is a basis 
    H = model.components_
    return W, H

def generate_component(W, n):
    Wn = W[:, n]
    rW = Wn.reshape((29, 25))
    plt.imshow(rW, cmap="Blues")
    plt.savefig(f"static\\component_{n}.png")

def create_img(W, H, m, n):
    Wn = W[:, m]
    Hn = H[:, n][m]
    V = Hn * Wn
    print(Hn)
    rV = V.reshape((29, 25))
    plt.imshow(rV, cmap="Blues")
    plt.savefig(f"static\\{m}.png")

